import React from 'react';
import logo from './logo.svg';
import './App.css';

const name = "Tanya Goel";
const day = new Date();
var hr = day.getHours();
if (hr >= 0 && hr < 12) {
  document.write("Good Morning!");
} else if (hr == 12) {
  document.write("Hi Sir!Good Noon!");
} else if (hr >= 12 && hr <= 17) {
  document.write("Hi Sir!Good Afternoon!");
} else {
  document.write("Hi Sir,Good Evening!");
}
function App() {

  return (
    <div className="text">
      <h1>My name is {name}</h1>
      <div className="img_div">
      </div>
    </div>
  );
}
export default App;
